        })} */}

      <RangeSelector
        values={[17, 23]}
        min={0}
        max={24}
        step={1}
        color="#363d87"
        className="ba"
        size="small"
      />
    </section>
  );
}

TimeBar.propTypes = propTypes;
TimeBar.defaultProps = defaultProps;
